import React from 'react';
import { Form, InputNumber, Slider, Input, Select } from 'antd';

const { Option } = Select;

const ParameterSettings = ({ parameters, setParameters }) => {

    const handleChange = (key, value) => {
        setParameters({ ...parameters, [key]: value });
    };

    return (
        <Form layout="vertical">
            <Form.Item label="模型选择">
                <Select value={parameters.model} onChange={(value) => handleChange('model', value)}>
                    <Option value="qwen/qwen-2-7b-instruct">qwen/qwen-2-7b-instruct</Option>
                    <Option value="deepseek/deepseek-r1/community">deepseek/deepseek-r1/community</Option>
                    {/* 根据需要添加更多选项 */}
                </Select>
            </Form.Item>
            <Form.Item label="温度">
                <Slider
                    min={0}
                    max={2}
                    step={0.1}
                    value={parameters.temperature}
                    onChange={(value) => handleChange('temperature', value)}
                />
            </Form.Item>
            <Form.Item label="最大 Tokens">
                <InputNumber
                    min={1}
                    value={parameters.max_tokens}
                    onChange={(value) => handleChange('max_tokens', value)}
                />
            </Form.Item>
            <Form.Item label="Top_p">
                <Slider
                    min={0}
                    max={1}
                    step={0.05}
                    value={parameters.top_p}
                    onChange={(value) => handleChange('top_p', value)}
                />
            </Form.Item>
            <Form.Item label="Top_k">
                <InputNumber
                    min={-1}
                    value={parameters.top_k}
                    onChange={(value) => handleChange('top_k', value)}
                    placeholder="-1 表示不限制"
                />
            </Form.Item>
            <Form.Item label="Min_p">
                <Slider
                    min={0}
                    max={1}
                    step={0.05}
                    value={parameters.min_p}
                    onChange={(value) => handleChange('min_p', value)}
                />
            </Form.Item>
            <Form.Item label="Stop 序列">
                <Input
                    value={parameters.stop}
                    onChange={(e) => handleChange('stop', e.target.value)}
                    placeholder="多个序列以逗号分隔"
                />
            </Form.Item>
            <Form.Item label="系统提示语">
                <Input
                    value={parameters.systemPrompt}
                    onChange={(e) => handleChange('systemPrompt', e.target.value)}
                />
            </Form.Item>
        </Form>
    );
};

export default ParameterSettings;
